import React from "react";

const Comment = ({ text, upvotes, downvotes }) => {
  return (
    <div>
      <p>{text}</p>
      <div>
        <button onClick={upvotes}>Upvote</button>
        <button onClick={downvotes}>Downvote</button>
      </div>
    </div>
  );
};

export default Comment;
